describe("simpleQueryString()",function(){"use strict";it("exists",function(){expect(simpleQueryString).to.be.a("object")}),it("parse validation: empty",function(){expect(simpleQueryString.parse("")).to.be.a("object"),expect(simpleQueryString.parse()).to.be.a("object"),expect(simpleQueryString.parse(null)).to.be.a("object"),expect(simpleQueryString.parse("http://www.whatever.com")).to.be.a("object")}),it("parse validation: with anchor",function(){var e=simpleQueryString.parse("http://www.whatever.com?var=val#anchor");expect(e["var"]).to.equal("val")}),it("parse validation: with anchor partial url",function(){var e=simpleQueryString.parse("var=val#anchor");expect(e["var"]).to.equal("val")}),it("stringify validation: array",function(){var e=simpleQueryString.stringify({my:[1,2,3,4]});expect(e).to.equal("my=1&my=2&my=3&my=4")}),it("stringify validation: boolean",function(){var e=simpleQueryString.stringify({p1:!0,p2:!1});expect(e).to.equal("p1=true&p2=false")})});